    const userData = async () => {
      const response = await API.getBets();
      console.log(response);
      return response;
    }
    userData();
  }, []);

  return (
    <div>
      <div className='dashboard-title'>Welcome User!</div>
    </div>
  );
};

export default UserDashboard;
